  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113608 includes chemical,
  discrete sample, physical and profile data collected from MIRAI in the North Pacific
  Ocean and South Pacific Ocean from 2002-12-17 to 2003-02-14 and retrieved during
  cruise MR02-K06 Leg 2-4 and PACIFICA_49NZ20021217. These data include DISSOLVED
  INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE,
  Potential temperature (theta), SALINITY, SILICATE, WATER TEMPERATURE and pH. The
  instruments used to collect these data include CTD, Coulometer for DIC measurement
  and bottle. These data were collected by Ando Kentaro and Kazuhiko Matsumoto of
  Japan Agency for Marine-Earth Science and Technology (Jamstec) and Masao Ishii of
  Meteorological Research Institute; Geochemical Research Department as part of the
  PACIFICA_49NZ20021217 data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an
  international collaborative project for the data synthesis of ocean interior carbon
  and its related parameters in the Pacific Ocean. The North Pacific Marine Science
  Organization (PICES), Section of Carbon and Climate (S-CC) supported the project.\",\n\t\"owner_org\":
